DROP TABLE IF EXISTS `td_assess_baseinfo`;
CREATE TABLE `td_assess_baseinfo`  (
  `ASSESS_BASE_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '评估基本表id',
  `IS_OPEN` int(1) NULL DEFAULT 0 COMMENT '0为最新数据，1为往期数据',
  `PEOPLEID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '老人id',
  `ASSESS_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '评估编号',
  `BASE_DATE` date NULL DEFAULT NULL COMMENT '评估基准日期',
  `NAME` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '老人姓名',
  `ASSESS_CAUSE` int(1) NOT NULL COMMENT '评估原因：\n1第一次评估；2常规评估；3状况变化后评估',
  `ASSESS_RESULT` int(1) NULL DEFAULT NULL COMMENT '初评结果',
  `ASSESS_END_RESULT` int(1) NULL DEFAULT NULL COMMENT '最终评级',
  `ASSESS_PEOPLE` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '评估人',
  `INFORMANT` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '信息提供者',
  `RELATION` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '信息提供者与老人的关系',
  `GENDER` int(1) NULL DEFAULT NULL COMMENT '老人性别：0-男；1-女',
  `BIRTHDAY` date NULL DEFAULT NULL COMMENT '老人出生日期',
  `ASSESS_AGE` int(1) NULL DEFAULT NULL COMMENT '老人年龄分级',
  `ID_CARD` varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '老人身份证号码',
  `SOCIAL_INSURANCE_CARD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '老人社保卡号',
  `PHONE` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '本人电话',
  `LINKMANN_NAME` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '联系人姓名',
  `LINKMAN_PHONE` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '联系人电话',
  `NATION` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '民族',
  `RELIGION` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '宗教信仰',
  `EDUCATION` int(1) NULL DEFAULT NULL COMMENT '教育程度：\n1文盲及半文盲；2小学；3初中；4高中/技校/中专；5大专及以上；6不详',
  `PROFESSION` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '职业',
  `MARRIAGE` int(1) NULL DEFAULT NULL COMMENT '1未婚；2已婚；3丧偶；4离婚；5未说明的婚姻状况',
  `PAYMENT` int(2) NULL DEFAULT NULL COMMENT '1城镇职工基本医疗保险；\n2城镇居民基本医疗保险；3新型农村合作医疗；4贫困救助；5商业医疗保险；6全公费；7全自费；8其他',
  `RESIDENCE` int(2) NULL DEFAULT NULL COMMENT '居住状况：1独居；2与配偶/伴侣居住；3与子女居住；4与父母居住；5与兄弟姐妹居住；6与其他亲属居住；7与非亲属关系的人居住；8养老机构',
  `ECONOMIC_SOURCE` int(1) NULL DEFAULT NULL COMMENT '经济来源：1退休金/养老金；2子女补贴；3亲友资助；4其他补贴；',
  `DIAGNOSE_DEMENTIA` int(1) NULL DEFAULT NULL COMMENT '疾病诊断-痴呆：0无；1轻度；2中度；3重度',
  `DIAGNOSE_SPIRIT` int(1) NULL DEFAULT NULL COMMENT '疾病诊断-精神疾病：0无；1精神分裂症；2双相情感障碍；3偏执性精神障碍；4分裂情感性障碍；5癫痫所致精神障碍；6精神发育迟滞伴发精神障碍',
  `DIAGNOSE_ELSE` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '疾病诊断-其他',
  `ACCIDENT_TUMBLE` int(1) NULL DEFAULT NULL COMMENT '近30天内意外时间-跌倒\n0无；1 发生过一次；2发生过两次；3发生过三次及以上',
  `ACCIDENT_LOST` int(1) NULL DEFAULT NULL COMMENT '意外-走失：\n0无；1 一次；2 两次；3 三次及以上',
  `ACCIDENT_CHOKE` int(1) NULL DEFAULT NULL COMMENT '意外-噎食：0 无；1 一次；2 两次；3 三次及以上',
  `ACCIDENT_SUICIDE` int(1) NULL DEFAULT NULL COMMENT '意外-自杀：\n0 无；1 一次；2 两次；3 三次及以上',
  `ACCIDENT_ELSE` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '意外-其他情况',
  `CREATED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `CREATED_TIME` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`ASSESS_BASE_ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = DYNAMIC;

