  `ASSESS_BASE_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '评估基本表id',
  `COMMUNICATION_TOTAL_POINTS` int(1) NULL DEFAULT NULL COMMENT '感知觉与沟通总分：\n0 能力完好：意识0，视力和听力为0或1，沟通0\n1 轻度受损：意识0，视力听力至少一项2，或沟通1；\n2中度受损：意识0，视力听力至少一项3，或沟通2。或嗜睡，视力听力3及以下，沟通2及以下；\n3 重度受损：意识清醒或嗜睡，但听力或视力至少一项为4，或沟通3。或昏睡/昏迷',
