  `FEED` int(2) NULL DEFAULT NULL COMMENT '进食：\n10可独立；5 需部分帮助；0 需极大帮助或完全依赖，或有留置胃管',
  `BATH` int(1) NULL DEFAULT NULL COMMENT '洗澡：  5 可独立完成；0 需帮助',
  `BEDECK` int(1) NULL DEFAULT NULL COMMENT '修饰：指洗脸刷牙等\n5 可独立完成；\n0 需帮助',
  `DRESSED` int(1) NULL DEFAULT NULL COMMENT '穿衣： 10 可独立；5 需部分帮助； 0 需极大帮助或完全依赖',
  `SHIT_CONTROL` int(1) NULL DEFAULT NULL COMMENT '大便控制：\n10 可控制 ；5 偶尔失控； 0 完全失控',
  `THEY_CONTROL` int(2) NULL DEFAULT NULL COMMENT '小便控制：10 可控制；5 偶尔失控； 0 完全失控',
  `GOTO_TOILET` int(2) NULL DEFAULT NULL COMMENT '如厕-包括去厕所，脱衣，擦拭，穿衣：\n10 可独立； 5 需部分帮助；0 需极大帮助或完全依赖',
  `SHIFT` int(2) NULL DEFAULT NULL COMMENT '床椅转移：\n15 可独立； 10 需部分帮助； 5 需极大帮助 ； 0 完全依赖',
  `WALK` int(2) NULL DEFAULT NULL COMMENT '平地行走：15 可独立；10 需部分帮助； 5 需极大帮助； 0 完全依赖',
  `STAORS` int(2) NULL DEFAULT NULL COMMENT '上下楼梯：10 可独立； 5 需部分帮助； 0 需极大帮助或完全依赖',
  `CREATED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `CREATED_TIME` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`DAILY_LIFE_ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = DYNAMIC;

